import React from "react";
import { Route, Routes } from "react-router-dom";
import UserProfile from "./UserProfile";
import PostList from "./PostList";

function User() {
  return (
    <Switch>
      <Route path={"/users/:userId/posts"}>
        <PostList />
      </Route>
      <Route path={"/users/:userId"}>
        <UserProfile />
      </Route>
    </Switch>
  );
};

export default User;
